class Solution {
public:
    int maxOperations(string s) {
        int n = s.size();
        int cnt = 0, one = 0, f = 0;
        for (int i = 0; i < n; i++){
            if (s[i] == '1') {
                one++;
                f = 1;
            }
            else {
                if (f){
                    cnt += one;
                    f = 0;
                }
            }
        }
        return cnt;
    }
};
